import React from "react";
import { useNavigate } from "react-router-dom";
import { FileText, Pills, Heart, Calendar } from "lucide-react";

const Patients = () => {
  const navigate = useNavigate();
  const patients = [
    {
      id: "P001",
      name: "John Doe",
      lastVisit: "2024-04-10",
      riskLevel: "Low",
      nextCheckup: "2024-05-10",
    },
    {
      id: "P002",
      name: "Jane Smith",
      lastVisit: "2024-04-09",
      riskLevel: "High",
      nextCheckup: "2024-04-20",
    },
  ];

  const ActionButton = ({ icon: Icon, label, onClick }) => (
    <button
      onClick={onClick}
      className="inline-flex items-center px-3 py-1.5 text-sm font-medium text-blue-600 hover:text-blue-700 dark:text-blue-400 dark:hover:text-blue-300"
    >
      <Icon className="w-4 h-4 mr-1" />
      {label}
    </button>
  );

  return (
    <div className="bg-white dark:bg-gray-800 rounded-lg shadow">
      <div className="px-6 py-4 border-b border-gray-200 dark:border-gray-700">
        <h2 className="text-xl font-semibold text-gray-800 dark:text-white">
          Patients
        </h2>
      </div>
      <div className="overflow-x-auto">
        <table className="min-w-full divide-y divide-gray-200 dark:divide-gray-700">
          <thead className="bg-gray-50 dark:bg-gray-900">
            <tr>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 dark:text-gray-400 uppercase tracking-wider">
                ID
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 dark:text-gray-400 uppercase tracking-wider">
                Name
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 dark:text-gray-400 uppercase tracking-wider">
                Last Visit
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 dark:text-gray-400 uppercase tracking-wider">
                Risk Level
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 dark:text-gray-400 uppercase tracking-wider">
                Actions
              </th>
            </tr>
          </thead>
          <tbody className="bg-white dark:bg-gray-800 divide-y divide-gray-200 dark:divide-gray-700">
            {patients.map((patient) => (
              <tr key={patient.id}>
                <td className="px-6 py-4 whitespace-nowrap text-sm font-medium text-gray-900 dark:text-white">
                  {patient.id}
                </td>
                <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500 dark:text-gray-400">
                  {patient.name}
                </td>
                <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500 dark:text-gray-400">
                  {patient.lastVisit}
                </td>
                <td className="px-6 py-4 whitespace-nowrap">
                  <span
                    className={`px-2 py-1 text-xs font-medium rounded-full ${
                      patient.riskLevel === "High"
                        ? "bg-red-100 text-red-800 dark:bg-red-900 dark:text-red-200"
                        : "bg-green-100 text-green-800 dark:bg-green-900 dark:text-green-200"
                    }`}
                  >
                    {patient.riskLevel}
                  </span>
                </td>
                <td className="px-6 py-4 whitespace-nowrap text-sm space-x-4">
                  <ActionButton
                    icon={FileText}
                    label="Risk Report"
                    onClick={() =>
                      navigate(`/patients/${patient.id}/risk-report`)
                    }
                  />
                  <ActionButton
                    icon={Pills}
                    label="Drug Interactions"
                    onClick={() =>
                      navigate(`/patients/${patient.id}/drug-interactions`)
                    }
                  />
                  <ActionButton
                    icon={Heart}
                    label="Wellness Plan"
                    onClick={() =>
                      navigate(`/patients/${patient.id}/wellness-plan`)
                    }
                  />
                  <ActionButton
                    icon={Calendar}
                    label="Check-up"
                    onClick={() => navigate(`/patients/${patient.id}/checkup`)}
                  />
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Patients;
